import React, { useState } from "react";
import styled from "styled-components";
import RenderMovies from "../screens/MoviePages/RenderMovies";

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 800px;
  background-color: rgb(20, 20, 50);
  padding: 20px;
`;

const Search = () => {
  return (
    <Wrapper>
      <RenderMovies fetchUrl='https://api.themoviedb.org/3/movie/now_playing?language=en-US&page=1' />;
    </Wrapper>
  );
};

export default Search;
